package nl.robobank.mongo.model;import nl.rabobank.mongo.model.UserModel;import nl.robobank.TestUtil;import org.junit.jupiter.api.DisplayName;import org.junit.jupiter.api.Test;import static org.assertj.core.api.Assertions.assertThat;public class UserTestModel {    @Test    @DisplayName("user verify equals")    void equalsVerifier() throws Exception {        TestUtil.equalsVerifier(UserModel.class);        UserModel user1 = UserModel.builder().id("id").build();        UserModel user2 = UserModel.builder().id("id2").build();        user2.setId(user1.getId());        assertThat(user1).isEqualTo(user2);        user2.setId("id2");        assertThat(user1).isNotEqualTo(user2);        user1.setId(null);        assertThat(user1).isNotEqualTo(user2);    }}